export default class Bio extends Component {
  render() {
    return (
      <div className="bio-container">
        <div className="bio-header">
          <h2>About Me</h2>
        </div>
        <div className="boxed">
          <div className="bio-item">
            <p className="oneandquarter">
              Bootcamp grad and software engineer at Bloomberg LP in New York. I
              have a background in math and came to programming from
              quantitative finance. Check out my portfolio
            </p>
            <a className="btn" href="/Portfolio">
              <p className="oneandquarter">
                Check out my portfolio
                {/* <i className="right_white"></i> */}
                <div>
                  Icons made by{" "}
                  <a
                    href="https://www.flaticon.com/authors/prettycons"
                    title="prettycons"
                  >
                    prettycons
                  </a>{" "}
                  from{" "}
                  <a href="https://www.flaticon.com/" title="Flaticon">
                    www.flaticon.com
                  </a>
                </div>
              </p>
            </a>
          </div>
        </div>
      </div>
    );
  }
}
